import Note from "./Note";
import Button from "./Button";

const Person = (props) => {
  return (
    <div>
      {props.searchFunc().map((person) => {
        <div>
          <Note key={person.name} note={person} />
          <Button />
        </div>;
      })}
    </div>
  );
};

export default Person;
